package main

import (
	"context"
	"flag"
	"github.com/ethereum/go-ethereum/accounts/abi/bind"
	"github.com/ethereum/go-ethereum/common"
	"github.com/ethereum/go-ethereum/ethclient"
	"log"
	"math/big"
	"strings"
)

type Config struct {
	RPCHost    string
	RPCPort    int
	OutPath    string
	LvlLimit   int
	OnlyEpoch  bool
	RenderFile bool
}

// БИНАРНИК ТЕСТИРУЕМОГО КОНТРАКТА
// 

func main() {
	connect()
	Start()
}

func connect() {
	var contractAddressHex = "0xfc00beef00000000000000000000000000000101"
	var contractAddress = common.HexToAddress(contractAddressHex)
	// Create an IPC based RPC connection to a remote node
	conn, err := ethclient.Dial("http://localhost:18545") //"localhost:4001"
	if err != nil {
		log.Fatalf("Failed to connect to the Ethereum client: %v", err)
	}

	tkn, err := NewMain(contractAddress, conn)
	if err != nil {
		log.Fatalf("Failed to instantiate a Token contract: %v", err)
	}
	stkrs(tkn)

	log.Println("tkn:", tkn)
	epoch, err := tkn.CurrentEpoch(nil)
	if err != nil {
		log.Fatalf("Failed to instantiate a Token contract: %v", err)
	}
	log.Println("epoch1", epoch)


	br, err := tkn.BondedRatio(nil)
	if err != nil {
		log.Fatalf("Failed to get BondedRatio: %v", err)
	}
	log.Println("br", br)

	// Create an authorized transactor
	auth, err := NewMainTransactor(contractAddress, nil)
	if err != nil {
		log.Fatalf("Failed to create authorized transactor: %v", err)
	}
	log.Println("auth", auth)

	jsonKey := `{"address":"239fa7623354ec26520de878b52f13fe84b06971","crypto":{"cipher":"aes-128-ctr","ciphertext":"aac23e91aa1e3e3607dc27b5bef3897d35f36dc04c24d0e073fc3113f3dbce8c","cipherparams":{"iv":"b8c716ac43dc12c104aa78bc622a44a5"},"kdf":"scrypt","kdfparams":{"dklen":32,"n":262144,"p":1,"r":8,"salt":"3c94214d158299c39a20b54db531012152ee15d32b19c6ec8f5822cc0fe6905c"},"mac":"ee25ce806119bfdc261af2c6c093df433632590f9a23df78d41f1cb73c0630ff"},"id":"5b403cfe-d8e8-4c75-abcb-32929a229e69","version":3}`
	opts, err := bind.NewTransactor(strings.NewReader(jsonKey), "fakepassword")
	if err != nil {
		log.Fatalf("Failed to create authorized transactor: %v", err)
	}
	opts.GasLimit = 100000
	newEph := big.NewInt(100000)
	tx, err := tkn.MakeEpochSnapshots(opts, newEph)
	if err != nil {
		log.Fatalf("Failed to MakeEpochSnapshots: %v", err)
	}
	log.Printf("MakeEpochSnapshots pending: 0x%x\n", tx.Hash())
	log.Printf("tx.Data: %v", tx.Data())

	prog, err := conn.SyncProgress(context.TODO())
	if err != nil {
		log.Fatalf("Failed to SyncProgress: %v", err)
	}
	log.Printf("SyncProgress :%v", prog)

	pNum, err := conn.PendingTransactionCount(context.TODO())
	if err != nil {
		log.Fatalf("Failed to PendingTransactionCount: %v", err)
	}
	log.Println("PendingTransactionCount", pNum)

	err = conn.SendTransaction(context.TODO(), tx)
	if err != nil {
		log.Fatalf("Failed to SendTransaction: %v", err)
	}

	log.Println("tx", tx)
	epoch, err = tkn.CurrentEpoch(nil)
	if err != nil {
		log.Fatalf("Failed to instantiate a Token contract: %v", err)
	}
	log.Println("epoch2", epoch)
}

func stkrs(m *Main) {
	stkNum, err := m.StakersNum(nil)
	if err != nil {
		log.Fatalf("Failed to get StakersNum: %v", err)
	}
	log.Println("stkNum", stkNum)

	opts := makeOpts()
	tx, err := m.CrtStake(opts)
	if err != nil {
		log.Fatalf("Failed to get StakersNum: %v", err)
	}
	log.Printf("CreateStake pending: 0x%x\n", tx.Hash())

	stkNum, err = m.StakersNum(nil)
	if err != nil {
		log.Fatalf("Failed to get StakersNum: %v", err)
	}
	log.Println("stkNum", stkNum)
}

func makeOpts() *bind.TransactOpts {
	jsonKey := `{"address":"239fa7623354ec26520de878b52f13fe84b06971","crypto":{"cipher":"aes-128-ctr","ciphertext":"aac23e91aa1e3e3607dc27b5bef3897d35f36dc04c24d0e073fc3113f3dbce8c","cipherparams":{"iv":"b8c716ac43dc12c104aa78bc622a44a5"},"kdf":"scrypt","kdfparams":{"dklen":32,"n":262144,"p":1,"r":8,"salt":"3c94214d158299c39a20b54db531012152ee15d32b19c6ec8f5822cc0fe6905c"},"mac":"ee25ce806119bfdc261af2c6c093df433632590f9a23df78d41f1cb73c0630ff"},"id":"5b403cfe-d8e8-4c75-abcb-32929a229e69","version":3}`
	opts, err := bind.NewTransactor(strings.NewReader(jsonKey), "fakepassword")
	if err != nil {
		log.Fatalf("Failed to create authorized transactor: %v", err)
	}
	opts.GasLimit = 100000
	return opts
}

func Start() {
	var cfg Config
	var mode string

	flag.StringVar(&cfg.RPCHost, "host", "localhost", "Host for RPC requests")
	flag.IntVar(&cfg.RPCPort, "port", 4001, "Port for RPC requests")
	flag.IntVar(&cfg.LvlLimit, "limit", 0, "DAG level limit")
	flag.StringVar(&cfg.OutPath, "out", "", "Path of directory for save DOT files")
	flag.StringVar(&mode, "mode", "root", "Mode:\nroot - single shot to every root node changes\nepoch - single shot to every epoch")
	flag.BoolVar(&cfg.RenderFile, "render", true, "Render:\n true - render dot file to png image\n false - no rendering")
	flag.Parse()

	cfg.OnlyEpoch = mode == "epoch"

	start(cfg)
}

func start(cfg Config) {
	r := NewRPC(cfg.RPCHost, cfg.RPCPort)
	top, err := r.GetTopHeads()
	if err != nil {
		log.Println("continue", err)
		return
	}

	evnt, err := r.GetEvent("0x88760b077536b10619712c6817a5d3dc53b65a4ce8911a58e4c13300b33bbde7")
	if err != nil {
		log.Panic("GetEvent err", err)
	}

	hdr, err := r.GetEventHeader("0x000000010000055fc83042587f2b5806018da26a9eb4886eec459d6d142d6899")
	if err != nil {
		log.Panic("GetEventHeader err", err)
	}
	log.Println("top", top)
	log.Println("hdr", hdr)
	log.Println("evnt", evnt)
}
